import React from 'react';

function Add(x,y)
{
let z = x+y;
return (z);
}
export {Add};

function Sub(x,y)
{
let z = x-y;
return (z);
}
export {Sub};

function Mul(x,y)
{
let z = x*y;
return (z);
}
export {Mul};

function Divi(x,y)
{
let z = x/y;
//let s = z.toFixed(2)
return (z);
}
export {Divi};
